import React from "react";
import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";

function App() {
  return (
    <>
      <BrowserRouter>
        <div>
          <Switch>
            <Route path="/about">
              <About />
            </Route>
            <Route path="/Topics">
              <Topics />
            </Route>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </div>
      </BrowserRouter>
    </>
  );
}

export default App;

const Home = () => <h2 className="home">Home</h2>;
const About = () => <h2 className="about">About</h2>;
